function sort(arr) {
    for (var j = 0; j < arr.length - 1; j++) {
        for (var i = 0; i < arr.length - j -1; i++) {
            if (arr[i] > arr[i + 1]) {
                [arr[i],arr[i + 1]] = [arr[i + 1],arr[i]];
            }
        }
    }
    return arr;
}
module.exports = {
    sort:sort
};